import React from 'react';
import ReactDom from 'react-dom'
import Card from './App.jsx'
import './index.css'
import Cdata from './Links'


function Dcard(val){
  console.log(val)
  return (
    <>
      <Card
      imgPoster={val.imgPoster}
      title={val.title}
      name={val.name}
      link={val.link}
    />
    </>
  )
}


ReactDom.render(
  <>
    <h1 className="heading">List of top 5 web series in 2021</h1>
    Cdata.map(Dcard);

  </>,
  document.getElementById("root")
)
